import React from "react";
import logo from "../../Assets/Logo.png";

const Header = () => {
  return (
    <div className="flex flex-col">
      <div className="bg-[#EDEDDD]">
        <img src={logo} alt="Logo" className="w-full h-full object-contain" />
      </div>
    </div>
  );
};

export default Header;
